import React from "react";
import ImageTwo from "../images/landingpic.jpg";

const Home = () => {
  return (
    <>
      <img
        src={ImageTwo}
        alt="enfamil"
        className="h-full rounded mb-50 shadow"
      />
      {/* Flex container */}
      <div
        className="container flex flex-col-reverse md:flex-row items-center px-6 mx-auto
        mt-10 space-y-0 md:space-y-0"
      >
        {/* left item */}
        <div className="flex flex-col mb-32 space-y-12 md:w-1/2">
          <h1
            className="max-w-md text-4xt font-bold text-center md:text-5xl
            md:textleft"
          >
            Looking for formula? Start with our store locator.
          </h1>
        </div>
      </div>
    </>
  );
};

export default Home;
